// src/components/UpcomingSessions.js
import React from 'react';

const UpcomingSessions = () => {
  return (
    <div>
      <h2>Upcoming Sessions</h2>
      <p>Here is where you can see your upcoming tutoring sessions.</p>
    </div>
  );
};

export default UpcomingSessions;
